import React from 'react';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import L from 'leaflet';

// 自定义图标
const customIcon = new L.Icon({
  iconUrl: 'data:image/png;base64,', // 确保路径正确
  iconSize: [32, 32], // 图标大小
  iconAnchor: [16, 32], // 图标在地图上的锚点
  popupAnchor: [0, -32], // 弹出框相对于图标的位置
});

// 地图中心位置
const center = {
  lat: -37.787,
  lng: 175.279,
};

// 店铺位置
const locations = [
  {
    id: 1,
    name: 'Store 1',
    position: { lat: -37.7899, lng: 175.2905 },
  },
  {
    id: 2,
    name: 'Store 2',
    position: { lat: -37.7850, lng: 175.2780 },
  },
  {
    id: 3,
    name: 'Store 3',
    position: { lat: -36.8509, lng: 174.7645 },
  },
  {
    id: 4,
    name: 'Store 4',
    position: { lat: -36.8523, lng: 174.7680 },
  }
];

const LeafletMapPage = () => {
  return (
    <MapContainer center={center} zoom={14} style={{ height: '600px', width: '100%' }}>
      <TileLayer
        attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
      />
      {locations.map((location) => (
        <Marker key={location.id} position={location.position} icon={customIcon}>
          <Popup>{location.name}</Popup>
        </Marker>
      ))}
    </MapContainer>
  );
};

export default LeafletMapPage;
